import React from 'react';
import SubscriptionCard from '../components/SubscriptionCard';
import FAQ from '../components/FAQ';


const Subscribe: React.FC = () => {
  const openPaymentLink = (url: string) => {
    window.open(url, '_blank');
  };

  const faqData = [
    {
      question: "How does the revenue-sharing model work?",
      answer: " As a content creator on Pulse, you'll be directly compensated for the impact your content makes within the community. The more engagement and value your content generates, the more you'll earn through our revenue-sharing system."
    },
    {
      question: "What kind of content can I create on Pulse?",
      answer: "Pulse welcomes a wide range of fitness content, including workouts, exercise demonstrations, progress updates, and informative videos. Our Creators Hub provides the tools and support you need to craft engaging and impactful content."
    },
    {
      question: "Do I need to be a certified fitness professional to become a Sweat Equity Partner?",
      answer: "While professional certifications are valuable, they're not a requirement to become a content creator on Pulse. We welcome fitness enthusiasts from all backgrounds who have unique ideas, techniques, and experiences to share."
    },
    {
      question: "How does Pulse ensure the quality and safety of the content shared on the platform?",
      answer: "Pulse uses our AI model to moderated all the content, in addition to our dedicated team that reviews and moderates content before it is released on the platform to ensure it meets our community guidelines and safety standards. We also provide resources and support to help content creators produce high-quality, safe, and effective fitness content."
    },
    {
      question: "Can I connect with other fitness content creators on Pulse?",
      answer: "Absolutely! Pulse fosters a thriving community of like-minded individuals passionate about fitness. You'll have opportunities to connect, collaborate, and learn from other content creators within the platform."
    },
    {
      question: "Is there a cost to become a Sweat Equity Partner with Pulse?",
      answer: "Yes, there is an annual subscription fee to become a Sweat Equity Partner on Pulse. This fee helps support the platform's growth, maintenance, and the resources provided to content creators. However, we offer a 30-day free trial to new partners to explore the platform and it's benefits."
    },
  ];

  return (
    <div className="">
      <div className="mb-48 bg-white">
        {/* Title Section */}
        <div className="max-w-[1052.76px] mx-auto text-center my-10 mt-20">
        {/* Title Section */}
        <span className="text-black text-[56px] sm:text-[93.93px] font-normal font-['Thunder'] leading-[60px] sm:leading-[107.08px] tracking-wide">Become a member of </span>
        <span className="text-orange-500 text-[56px] sm:text-[93.93px] font-normal font-['Thunder'] leading-[60px] sm:leading-[107.08px] tracking-wide">The Fitness Collective</span>
        <br />
        <span className="text-black text-[30px] sm:text-[40px] font-normal font-['Thunder'] leading-[60px] sm:leading-[107.08px] tracking-wide">The first month is on us!</span>
      </div>

      {/* Feature List */}
      <div className="flex flex-col space-y-6 max-w-[500px] mx-auto text-left mt-8 mb-40">
        <div className="flex items-center gap-4">
          <span className="text-black text-xl font-medium font-['HK Grotesk'] leading-7">Unlock your potential with:</span>
        </div>
        <div className="flex items-center gap-4">
          <img src="/orange-check.png" alt="Check" className="w-[22px] h-[22px] object-cover" />
          <span className="text-black text-xl font-medium font-['HK Grotesk'] leading-7">Quick and easy access to workouts when you need them.</span>
        </div>

        <div className="flex items-center gap-4">
          <img src="/orange-check.png" alt="Check" className="w-[22px] h-[22px] object-cover" />
          <span className="text-black text-xl font-medium font-['HK Grotesk'] leading-7">Videos from community members that makes your exercies selection, endless.</span>
        </div>

        <div className="flex items-center gap-4">
          <img src="/orange-check.png" alt="Check" className="w-[22px] h-[22px] object-cover" />
          <span className="text-black text-xl font-medium font-['HK Grotesk'] leading-7">Intelligent workout tracking using AI, to create deep insight into your workouts</span>
        </div>

        <div className="flex items-center gap-4">
          <img src="/orange-check.png" alt="Check" className="w-[22px] h-[22px] object-cover" />
          <span className="text-black text-xl font-medium font-['HK Grotesk'] leading-7">You get 30 days free trial on us!</span>
        </div>
      </div>


        {/* Subscription Cards */}
        <div className="flex flex-col items-center">
          <div className="w-full bg-gray-100 p-20 sm:p-16 mb-64">
            {/* Subscription Cards */}
            <div className="flex flex-col sm:flex-row justify-center items-center gap-8">
              <SubscriptionCard
                price="$4.99"
                period="mo"
                description="Flexible, in case you decide to go it alone after a month."
                titleColor="text-black"
                textColor="text-black"
                backgroundColor="bg-white"
                actionText="Subscribe Now"
                actionBgColor="bg-neutral-800"
                actionTextColor="text-white"
                onActionClick={() => openPaymentLink('https://buy.stripe.com/9AQaFieX9bv26fSfYY')}
              />

              <SubscriptionCard
                price="$39.99"
                period="yr"
                description="Cost Effective, with commitment to your journey."
                titleColor="text-white"
                textColor="text-white"
                backgroundColor="bg-neutral-800"
                actionBgColor="bg-[#E0FE10]"
                actionText="Try now for 30 days"
                actionTextColor="text-zinc-800"
                onActionClick={() => openPaymentLink('https://buy.stripe.com/28obJm2an8iQdIk289')}
              />
            </div>
          </div>
        </div>


        {/* App Features Section */}
        <div className="flex flex-col gap-8 items-center justify-center mb-64">
          {/* Container for Title and Grid */}
          <div className="w-full max-w-[1052.76px] flex flex-col gap-8">
            {/* Section Title */}
            <div className="flex flex-col gap-4 sm:gap-6">
              <div className="text-zinc-600 text-3xl sm:text-4xl font-normal font-['Thunder'] uppercase leading-9">Support and Resources for Partners</div>
              <div className="w-full max-w-[791.1px] text-black text-[40px] sm:text-[64px] font-medium font-['Thunder'] leading-[45px] sm:leading-[79px]">We're committed to helping our partners succeed. Here's how we support you</div>
            </div>

            {/* Grid for App Features */}
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8">
              {/* First Feature */}
              <div className="flex flex-col gap-2">
                <div className="w-5 h-5"></div>
                {/* Feature Image Placeholder */}
                <div className="w-[305px] h-[273.87px] bg-gray-50"></div>
                <div className="text-black text-[22.5px] font-bold font-['HK Grotesk'] leading-loose">Lorem ipsum Lorem ipsum</div>
                <div className="w-[319px] text-neutral-600 text-base font-normal font-['HK Grotesk'] leading-tight">Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem</div>
              </div>

              {/* Second Feature */}
              <div className="flex flex-col gap-2">
                <div className="w-5 h-5"></div>
                {/* Feature Image Placeholder */}
                <div className="w-[305px] h-[273.87px] bg-gray-50"></div>
                <div className="text-black text-[22.5px] font-bold font-['HK Grotesk'] leading-loose">Lorem ipsum Lorem ipsum</div>
                <div className="w-[319px] text-neutral-600 text-base font-normal font-['HK Grotesk'] leading-tight">Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem</div>
              </div>

              {/* Third Feature */}
              <div className="flex flex-col gap-2">
                <div className="w-5 h-5"></div>
                {/* Feature Image Placeholder */}
                <div className="w-[305px] h-[273.87px] bg-gray-50"></div>
                <div className="text-black text-[22.5px] font-bold font-['HK Grotesk'] leading-loose">Lorem ipsum Lorem ipsum</div>
                <div className="w-[319px] text-neutral-600 text-base font-normal font-['HK Grotesk'] leading-tight">Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem ipsum Lorem</div>
              </div>
            </div>

            <div>
              <FAQ title="Frequently Asked Questions" items={faqData} />
            </div>
          </div>
        </div>

      </div>
    </div>
  );
};

export default Subscribe;
